import React from 'react';
import './styles/App.css';
import {BrowserRouter, Route,Routes} from "react-router-dom";
import Login from "./components/pages/login";


function App() {

    return (
        <BrowserRouter>
            <Routes>
                <Route path="/login" element={<Login />} />
            </Routes>
        </BrowserRouter>
    )
}

export default App;
